import React from "react";
import { View, Text, StyleSheet ,Dimensions} from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome5';
const { width, height } = Dimensions.get('window')

import { Input } from 'react-native-elements';

const LoginScreen = () => {
	return <View style={{ flex: 1, justifyContent: "center", marginBottom: 100 }}>
		<View style={{ margin: 20 }}>
			<View style={{ marginVertical: 5 }}>
				<Input
					placeholder='email'
					style={
						{
							padding: 10,
						}
					}
					leftIcon={
						<Icon
							name='user'
							size={24}
							color='black'
						/>
					}
				/>
			</View>
			<View style={{ marginVertical: 5 }}>
				<Input
					placeholder='Password'
					style={
						{
							padding: 10,
						}
					}
					leftIcon={
						<Icon
							name='unlock-alt'
							size={24}
							color='black'
						/>
					}
				/>
			</View>
			<View style={{ marginVertical: 5, marginHorizontal: 10 ,justifyContent:"center", alignItems:"center"}}>
				<Icon.Button
					name="user-lock"
					backgroundColor="black"
					style={{width:500,alignItems:"center",justifyContent:"center"}}
				>
					<Text style={{ fontFamily: 'Arial', textAlign:"center",fontSize: 15,color:"white" }}>
						Login
    				</Text>
				</Icon.Button>
			</View>


		</View>

	</View>
}


const styles = StyleSheet.create({

})

export default LoginScreen;
